import React, { Component } from 'react';
import { connect } from 'react-redux';
import { postUserInfo } from '../../Actions/actionCreator';

class Login extends Component {
    constructor(props) {
        super(props);
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }

    render() {
        return (
            <div>
                <form onSubmit={this.handleSubmit}>
                    <input value={this.state.username} name="username" onChange={e => () => (e.target.value)} placeholder="enter username" type="text"></input>
                    <input value={this.state.password} name="password" onChange={e => () => (e.target.value)} placeholder="enter password" type="password"></input>
                    <button type="submit">Log In</button>
                </form>
            </div>
        );
    }
}

const mapStateToProps = state => ({
    user : state.user.user
});

const mapDispatchToProps = {
    postUserInfo
}

export default connect(mapStateToProps, mapDispatchToProps)(Login);
